SELECT ?item ?itemLabel ?property ?propertyLabel WHERE {
  VALUES ?event {
    wd:Q51633
  }
  VALUES ?property {
    wdt:P527 wdt:P9343 wdt:P921
  }
  ?event ?property ?item .
  OPTIONAL {
    ?item rdfs:label ?itemLabel FILTER ( LANG( ?itemLabel ) = "en" )
  }
  OPTIONAL {
    ?property rdfs:label ?propertyLabel FILTER ( LANG( ?propertyLabel ) = "en" )
  }
}

PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT DISTINCT ?higherTaxon ?higherTaxonLabel WHERE {
  {
    wd:Q46231801 ( wdt:P31 | wdt:P279 ) ?higherTaxon .
  } UNION {
    wd:Q46231801 ( wdt:P31 | wdt:P279 ) / ( wdt:P279 ) ?higherTaxon .
  } UNION {
    wd:Q46231801 ( wdt:P31 | wdt:P279 ) / ( wdt:P279 ) / ( wdt:P279 ) ?higherTaxon .
  }
  FILTER ( ?higherTaxon != wd:Q46231801 ) OPTIONAL {
    ?higherTaxon rdfs:label ?higherTaxonLabel FILTER ( lang( ?higherTaxonLabel ) = "en" )
  }
}

