PREFIX skos: <http://www.w3.org/2004/02/skos/core#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT DISTINCT ?train ( SAMPLE( ?label ) AS ?anyLabel ) WHERE {
  ?train wdt:P1064 ?gauge .
  FILTER ( ?gauge = wd:Q1999572 || ( ?gauge = 1435 ) ) OPTIONAL {
    ?train rdfs:label ?label .
  }
  OPTIONAL {
    ?train skos:altLabel ?altLabel .
  }
  FILTER ( ( BOUND( ?label ) && CONTAINS( LCASE( ?label ) , "v250" ) ) || ( BOUND( ?altLabel ) && CONTAINS( LCASE( ?altLabel ) , "v250" ) ) )
}
GROUP BY ?train

PREFIX p: <http://www.wikidata.org/prop/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
SELECT ?director ?directorLabel ?relative ?relativeLabel ?kinship WHERE {
  wd:Q7730630 wdt:P57 ?director .
  OPTIONAL {
    ?director p:P1038 ?relStatement .
    ?relStatement ps:P1038 ?relative .
    OPTIONAL {
      ?relStatement pq:P1039 ?kinship .
    }
    OPTIONAL {
      ?relative rdfs:label ?relativeLabel FILTER ( lang( ?relativeLabel ) = "en" )
    }
  }
  OPTIONAL {
    ?director rdfs:label ?directorLabel FILTER ( lang( ?directorLabel ) = "en" )
  }
}

