PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT DISTINCT ?entity ?label WHERE {
  {
    ?entity ( wdt:P31 | wdt:P279 ) wd:Q1269299 .
  } UNION {
    ?entity ( wdt:P31 | wdt:P279 ) wd:Q10541491 .
  }
  ?entity rdfs:label ?label .
  FILTER ( LANG( ?label ) = "en" ) FILTER ( STRSTARTS( LCASE( ?label ) , "c" ) ) OPTIONAL {
    ?entity wdt:P17 ?country .
  }
  OPTIONAL {
    ?entity wdt:P1001 ?jurisdiction .
  }
  FILTER ( ( ! BOUND( ?country ) || ?country = wd:Q30 ) && ( ! BOUND( ?jurisdiction ) || ?jurisdiction = wd:Q30 ) )
}
ORDER BY ?label

